import React from 'react';

const Aboutme = () => {
    return (
        <motion.div className="signin"
                    initial={{ opacity: 0 }}
                    animate={{ opacity: 1 }}
                    exit={{ opacity: 0 }}>

        </motion.div>
    );
};

export default Aboutme;
